import React from 'react';
import getGenres from '../services/fakeGenreService';

const categories = () =>
{
    const allGenres = getGenres();
    console.log(allGenres);
    return ( 
        <React.Fragment>
           <div className="list-group">

           <a key="allGenres" href="/" className="list-group-item list-group-item-action"> All</a>

            {allGenres.map(genre => (
                <a key={genre._id} href="/" className="list-group-item list-group-item-action">{genre.name}</a>
            ))}

            </div>
        </React.Fragment>
    );
}

export default categories;
